import React from 'react'
import * as axios from "axios";


class ResouceDetails extends React.Component {
    state={
        details: {}
    }

    componentDidMount() {
        axios.get(this.props.state.actualResourceUrl).then(resp=>{
            this.setState({
                details: resp.data.results
            })
        })
    }

    componentDidUpdate(prevProps, prevState, snapshot) {
        if (prevProps!=this.props)
        {
            axios.get(this.props.state.actualResourceUrl).then(resp=>{
                this.setState({
                    details: resp.data.results
                })
            })
        }
    }


    render() {
        let newArr=this.state.details.map(i=>{
            return <div>
                    <span>{i.name}</span>
            </div>
        })
        return (<>
            <h3>{this.props.state.actualResourceName}</h3>
            <div>Привет</div>
            </>
        )
    }
}

export default ResouceDetails
